import React from 'react';

import Bag from '@assets/svg/bag.svg';
import Paper from '@assets/svg/paper.svg';
import PaperPlus from '@assets/svg/paperplus.svg';
import Search from '@assets/svg/search1.svg';

const index = () => {
    return (
        <div className="flex justify-center">
            <div className=" bottom-3 fixed">
                <div className="h-14 w-auto bg-black-50 rounded-full flex justify-center items-center">
                    <div className="flex text-white px-5 py-5">
                        <div className="flex items-center w-40">
                            <Bag />
                            <p>نمایشگاه</p>
                        </div>
                        <div className="flex items-center  w-40">
                            <Search />
                            <p>نمایشگاه</p>
                        </div>
                        <div className="flex items-center w-40 ">
                            <Paper />
                            <p>نمایشگاه</p>
                        </div>
                        <div className="flex items-center  w-40">
                            <PaperPlus />
                            <p>نمایشگاه</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default index;
